import React from 'react';
import Tilt from 'react-parallax-tilt';

const Logo = () =>{
	return(
		<div className='ma4 mt0'>
			<Tilt className="Tilt br2 shadow-2">
		      <div className="Tilt-inner">
		      </div>
	    	</Tilt>
		</div>
	);
}
export default Logo;
